import React, { useState } from 'react';
import { useLogout } from '../hooks/useLogout'
import { useAuthContext } from '../hooks/useAuthContext'


function Home(){
  const {logout}=useLogout()
  const {user}=useAuthContext()
  const handleZoomIn = (element) => {
    element.style.transform = 'scale(1.1)';
  };

  const handleZoomOut = (element) => {
    element.style.transform = 'scale(1)';
  };

  const handlelogout = ()=>{
    logout()
  }


  function navigateToPage() {
    var dropdown = document.getElementById("pageSelector");
    var selectedValue = dropdown.options[dropdown.selectedIndex].value;

    if (selectedValue === "page1") {
      window.location.href = "./test.js";
    } else if (selectedValue === "page2") {
      window.location.href = "https://www.youtube.com/";
    }
  }


  function showpwd1(){
    var pwd = document.getElementById("Password1");
  
    if(pwd.type === "Password1"){
      pwd.type = "text";
    }
    else{
      pwd.type = "Password1"
    }
  }


  function showpwd2(){
    var pwd = document.getElementById("Password2");
  
    if(pwd.type === "Password2"){
      pwd.type = "text";
    }
    else{
      pwd.type = "Password2"
    }
  }
  
  
  // check new password for 8 characters
  document.addEventListener("DOMContentLoaded", function () {
      var passwordInput = document.getElementById("Password2");
      var submitButton = document.getElementById("submit");
      var pwdError = document.getElementById("pwdError");

      passwordInput.addEventListener("input", function () {
          var newpwd = passwordInput.value;

          if (newpwd.length < 8) {
              pwdError.innerHTML = "New Password must be at least 8 characters";
              submitButton.disabled = true;
          } else {
              pwdError.innerHTML = "";
              submitButton.disabled = false;
          }
      });
  });
    return(
      <div >


       
        {/* Pictures changing  */}
        <div className="container d-flex justify-content-center mt-3 vh-75">
            <div id="imageCarousel" className="carousel slide" data-bs-ride="carousel">
                <div className="carousel-inner">
                    <div className="carousel-item active">
                        <img src="change1.png" className="d-block w-75 mx-auto" alt="Image 1"></img>
                    </div>
                    <div className="carousel-item">
                        <img src="change2.png" className="d-block w-75 mx-auto" alt="Image 2"></img>
                    </div>
                     {/* Add more carousel items with additional images  */}
                </div>
                <button className="carousel-control-prev" type="button" data-bs-target="#imageCarousel" data-bs-slide="prev">
                    <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                    <span className="visually-hidden">Previous</span>
                </button>
                <button className="carousel-control-next" type="button" data-bs-target="#imageCarousel" data-bs-slide="next">
                    <span className="carousel-control-next-icon" aria-hidden="true"></span>
                    <span className="visually-hidden">Next</span>
                </button>
            </div>
        </div>

        <div className="booknow d-flex justify-content-center mt-4 w-100">
          <select id="pageSelector" className="me-4 rounded">
          <option value="page1">Kalutara</option>
          <option value="page2">Kataragama</option>
          </select>
          <button className="btn btn-secondary"  onclick="navigateToPage()">Book Now</button>
        </div>

        <div className="middle row d-flex justify-content-around">
        <div
          className="card text-bg-dark mt-4"
          style={{width: '45vw'}}
          onMouseOver={(e) => handleZoomIn(e.currentTarget.querySelector('.card-img'))}
          onMouseOut={(e) => handleZoomOut(e.currentTarget.querySelector('.card-img'))}
        >
          <img
            src="kal.jpg"
            className="card-img"
            alt="..."
            style={{
              width: '46vw',
              transition: 'transform 0.3s',
            }}
          />
          <div className="card-img-overlay">
            <h5 className="card-title">Card title</h5>
            <p className="card-text">
              This is a wider card with supporting text below as a natural lead-in
              to additional content. This content is a little bit longer.
            </p>
            <a href="" className="text-white fw-bold">
              View
            </a>
          </div>
        </div>

        <div
          className="card text-bg-dark mt-4"
          style={{width: '45vw'}}
          onMouseOver={(e) => handleZoomIn(e.currentTarget.querySelector('.card-img'))}
          onMouseOut={(e) => handleZoomOut(e.currentTarget.querySelector('.card-img'))}
        >
          <img
            src="kal.jpg"
            className="card-img"
            alt="..."
            style={{
              width: '46vw',
              transition: 'transform 0.3s',
            }}
          />
          <div className="card-img-overlay">
            <h5 className="card-title">Card title</h5>
            <p className="card-text">
              This is a wider card with supporting text below as a natural lead-in
              to additional content. This content is a little bit longer.
            </p>
            <a href="" className="text-white fw-bold">
              View
            </a>
          </div>
        </div>
      </div>

       
        <h1 className="text-center mb-5 mt-5 custom-font">Facilities you will always enjoy</h1>

         <div className="row mt-3 justify-content-around">
            <div className="card" style={{width: "18rem"}}>
               <img src="image.jpg" className="card-img-top pt-3" alt="..."></img>
               <div className="card-body">
                 <h5 className="card-title text-center">Wedding hall</h5>
                
               </div>
               
               <div className="card-body d-flex justify-content-center">
                 <a href="#" className="text-decoration-none">Card link</a>
                 <a href="#" className="text-decoration-none ms-4">Another link</a>
               </div>
             </div>
         
                   
             <div className="card" style={{width: "18rem"}}>
               <img src="image.jpg" className="card-img-top pt-3" alt="..."></img>
               <div className="card-body">
                 <h5 className="card-title text-center">Wedding hall</h5>
                
               </div>
               
               <div className="card-body d-flex justify-content-center">
                 <a href="#" className="text-decoration-none">Card link</a>
                 <a href="#" className="text-decoration-none ms-4">Another link</a>
               </div>
             </div>
             
                   
            <div className="card" style={{width: "18rem"}}>
               <img src="image.jpg" className="card-img-top pt-3" alt="..."></img>
               <div className="card-body">
                 <h5 className="card-title text-center">Wedding hall</h5>
                
               </div>
               
               <div className="card-body d-flex justify-content-center">
                 <a href="#" className="text-decoration-none">Card link</a>
                 <a href="#" className="text-decoration-none ms-4">Another link</a>
               </div>
             </div>
         
             <div className="card" style={{width: "18rem"}}>
               <img src="image.jpg" className="card-img-top pt-3" alt="..."></img>
               <div className="card-body">
                 <h5 className="card-title text-center">Wedding hall</h5>
                
               </div>
               
               <div className="card-body d-flex justify-content-center">
                 <a href="#" className="text-decoration-none">Card link</a>
                 <a href="#" className="text-decoration-none ms-4">Another link</a>
               </div>
             </div>
             
          </div>


           {/* quote about hotel chain  */}
           <div className="card text-bg-dark mt-5">
             <img src="katha.jpg" className="card-img" alt="..." style={{width: "99vw", height: "50vh"}}></img>
             <div className="card-img-overlay">
               
               <p className="card-text">"This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer"</p>
               <a href="" className="text-white fw-bold btn btn-outline-primary">BooK Now</a>
             </div>
           </div>



           <div className="offcanvas offcanvas-start" tabindex="-1" id="offcanvas" aria-labelledby="offcanvasLabel" >
             <div className="offcanvas-header">
               <h4 className="offcanvas-title" id="offcanvasLabel">Profile</h4>
               <button type="button" className="btn-close" data-bs-dismiss="offcanvas" aria-label="Close"></button>
             </div>
               <div className="offcanvas-body">
                 <div className="container w-100 h-100 bg-body-tertiary pt-4 ">
                 
                 <form action="updatePwdServlet" method="post" className="mt-4">
                     <h5 className="mb-4 ps-1">Change Password</h5>
                     <div className="row ps-2 bg-secondary">
                       <input type="password" placeholder="Current Password" id="Password1" name="Password1" className="w-75 col-9"></input>
                       <div className="btn col" onclick="showpwd1();">Show</div>
                     </div><br/>
                     <div className="row ps-2 bg-secondary">
                       <input type="password" placeholder="New Password" id="Password2" name="Password2" className=" w-75 col-9" onchange="change();"></input>
                       <div className="btn col" onclick="showpwd2();">Show</div>
                     </div>
                     
                     <input type="hidden" name="email" value="${user.getEmail()}"></input>
                    
                     <span id="pwdError" style={{color: "red"}}></span>
                     <button className="btn btn-outline-primary mt-4" name="submit" id="submit" >Change</button>
                  </form>
                    <div style={{position: "relative", top: "60px"}}>
                      <h5 className="ps-1">Delete account</h5>
                      <div type="submit" className="btn btn-danger mt-3" id="submit" data-bs-toggle="modal" data-bs-target="#Modal">Delete My Account</div>
                    </div>
               
                  </div>
                </div>
           </div>
        

 
               {/* model  */}
              <div className="modal fade" id="Modal" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
                <div className="modal-dialog">
                  <div className="modal-content">
                    <div className="modal-header">
                      <h1 className="modal-title fs-5" id="exampleModalLabel">Are You Sure?</h1>
                      <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                    </div>
                    <div className="modal-body">
                      This is Permenent. You can not recover account after deletion.
                    </div>
                    <div className="modal-footer">
                      <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">Close</button>
                     
                       <form action="DeleteAccountservlet" method="post">
                        <input type="hidden" name="email" value="${user.getEmail()}"></input>
                        <button type="submit" className="btn btn-outline-danger">DELETE</button>
                       </form>
                    
                    </div>
                  </div>
                </div>
              </div>

            
    
</div>


        

    )

}



export default Home;
